import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Nav = styled.nav`
  background-color: ${({ theme }) => theme.colors.primary};
  padding: 1rem;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Logo = styled.div`
  font-weight: bold;
  font-size: 1.2rem;
  color: white;
`;

const NavLinks = styled.ul`
  list-style: none;
  margin: 0;
  padding: 0;
  display: flex;
  gap: 1rem;
`;

const NavLink = styled(Link)`
  text-decoration: none;
  color: white;
  padding: 0.5rem 1rem;
  border-radius: ${({ theme }) => theme.borderRadius};
  background-color: ${({ theme }) => theme.colors.secondary};
`;

function Navigation() {
  return (
    <Nav>
      <Logo>üåøAgro Neural</Logo>
      <NavLinks>
        <li><NavLink to="/">Chatbot</NavLink></li>
        <li><NavLink to="/dashboard">üìä Irriga√ß√£o inteligente</NavLink></li>
        <li><NavLink to="/settings">‚öôÔ∏è Configura√ß√µes</NavLink></li>
        <li><NavLink to="/iot">üì∂ IoT Status</NavLink></li>
      </NavLinks>
    </Nav>
  );
}

export default Navigation;
